const getLink = '[data-hook="link"]';
const getBrand = '[data-hook="brand"]';
const getReview = '[data-hook="review"]';
const getReviewUrl = '[data-hook="review-url"]';
const getReviewDate = '[data-hook="review-date"]';
const getReviewText = '[data-hook="review-body"]';
const getReviewStars = '[data-hook="review-star-rating"]';
const getReviewTitle = '[data-hook="review-title"]';
const getReviewHelpful = '[data-hook="helpful-vote-statement"]';
const getReviewIsVerifiedPurchase = '[data-hook="avp-badge"]';

export default {
  getLink,
  getBrand,
  getReview,
  getReviewUrl,
  getReviewDate,
  getReviewText,
  getReviewStars,
  getReviewTitle,
  getReviewHelpful,
  getReviewIsVerifiedPurchase,
};
